import React from 'react'
import style from './index.module.scss'
export default function index() {
  const handleSub = (e) => {
    console.log(e.target.value);
  }
  return (
    <div className={style.bg}>
      <div className={style.subBar} onClick={handleSub}>
        <a className={style.subItem}><div className={`${style.ball} ${style.itemOne}`}></div> 游乐场</a>
        <a className={style.subItem}><div className={`${style.ball} ${style.itemTwo}`}></div>噩梦</a>
        <a className={style.subItem}><div className={`${style.ball} ${style.itemThree}`}></div>PH</a>
      </div>
    </div>
  )
}
